  testComputedExpression("bitwiseor0", "4 | 4", 4);
  testComputedExpression("bitwiseor1", "5 | 2", 7);
  testComputedExpression("bitwiseor2", "7 | 3", 7);
  testComputedExpression("bitwiseor3", "-1 | -5", -1);
  testComputedExpression("bitwiseor4", "-1 | 25", -1);
